  '<b>Important note:</b> The transfer wizard is not able to assist with moving media items. You will need to set up and move or copy your media configuration and objects separately after the transfer wizard is finished.' => '<b>Важное Примечание:</b> Мастер переноса не поддерживает передачу мультимедийных объектов. Вам нужно будет настроить, переместить или скопировать Вашу медиаконфигурацию и объекты отдельно после завершения работы мастера.',
  '<b>Please note:</b> Private information of living individuals will only be given to family relatives and close friends. You will be asked to verify your relationship before you will receive any private data. Sometimes information of dead individuals may also be private. If this is the case, it is because there is not enough information known about the individual to determine whether they are alive or not and we probably do not have more information on this individual.<br><br>Before asking a question, please verify that you are inquiring about the correct individual by checking dates, places, and close relatives. If you are submitting changes to the genealogy data, please include the sources where you obtained the data.' => '<b>Обратите внимание:</b> частная информация живых людей будет даваться только родственникам и близким друзьям. Вам будет предложено проверить Ваши родственные связи, прежде чем Вы получите какие-либо личные данные. Иногда информация умерших людей, также может быть частной. Возможно также, что это потому, что не хватает информации об этом человеке, чтобы определить, жив ли он или нет, и мы, вероятно, не имеем больше информации об этом человеке.<br><br>Прежде чем задавать вопрос, пожалуйста, убедитесь, что Вы спрашиваете о правильном человеке, проверяя даты, места жизни и близких родственников. Если Вы вносите изменения в генеалогические данные, пожалуйста, укажите источники, где Вы получили эти данные.',
