  '<div class="largeError">Notice:</div><div class="error">By completing and submitting this form, you agree:<ul><li>to protect the privacy of living individuals listed on our site;</li><li>and in the text box below, to explain to whom you are related, or to provide us with information on someone who should be listed on our website.</li></ul></div>' => '<div class="largeError">Примечание:</div><div class="error">Заполнив и отправив эту форму, Вы соглашаетесь:<ul><li>защищать частную информацию живых персон перечисленных на нашем сайте;</li><li>в текстовом поле «Комментарии» укажите подробную информацию кому Вы приходитесь родственником или информацию о ком хотели бы сообщить.</li></ul></div>',
