  'A child may have more than one set of parents. The relationship between the child and the parents can be biological, legal, or based on local culture and tradition. If no pedigree is specified, then a biological relationship will be assumed.' => 'Ребенок может иметь более несколько родителей. Отношения между ребенком и родителями могут быть биологические, правовые, или на основе местной культуры и традиций. Если родословная не указана, то будет принято биологическое родство.',
  'A common error is to have multiple links to the same record, for example listing the same child more than once in a family record.' => 'Является распространенной ошибкой, чтобы на одну и туже запись имелось несколько ссылок. Например, перечисление того же ребенка больше, чем один раз в записи о семье.',
