  'Each source records specific events, generally for a given date range and for a place jurisdiction. For example a Census records census events and church records record birth, marriage, and death events.<br><br>Select the events that are recorded by this source from the list of events provided. The date should be specified in a range format such as <i>FROM 1900 TO 1910</i>. The place jurisdiction is the name of the lowest jurisdiction that encompasses all lower-level places named in this source. For example, “Oneida, Idaho, USA” would be used as a source jurisdiction place for events occurring in the various towns within Oneida County. “Idaho, USA” would be the source jurisdiction place if the events recorded took place not only in Oneida County but also in other counties in Idaho.' => 'Каждый источник записывает конкретные события, как правило, для данного диапазона дат и административной области. Например, переписи населения, переписи события, церковные записи, запись о рождении, браке, и смерть.<br><br>Выберите события, которые записываются с помощью этого источника из списка событий. Даты должны быть указаны в формате диапазона, например, <i>с 1900 по 1910</i>. Административная область - это название маленькой административной единицы, которая включает в себя все места в этом источнике. Например, «Онейда, штат Айдахо, США» будут использоваться в качестве источника административной области для событий, происходящих в разных городах в пределах Oneida County. «Штат Айдахо, США» будет административной области, если описанные события имели место не только в Oneida County, но и в других уездах в Айдахо.',
  'Each user account has an option to “automatically accept changes”. When this is enabled, any changes made by that user are saved immediately. Many administrators enable this for their own user account.' => 'Каждая учетная запись пользователя имеет параметр "автоматически принимать изменения". Когда этот параметр включен, любые изменения, внесенные пользователем, сохраняются немедленно. Многие администраторы включают этот параметр в учетной записи пользователя.',
