  'Email address to be used in the “From:” field of emails that webtrees creates automatically.<br><br>webtrees can automatically create emails to notify administrators of changes that need to be reviewed. webtrees also sends notification emails to users who have requested an account.<br><br>Usually, the “From:” field of these automatically created emails is something like <i>From: webtrees-noreply@yoursite</i> to show that no response to the email is required. To guard against spam or other email abuse, some email systems require each message’s “From:” field to reflect a valid email account and will not accept messages that are apparently from account <i>webtrees-noreply</i>.' => 'Адрес электронной почты, который будет отображаться в поле "От:" ("From:") сообщений, отправляемых автоматически webtrees.<br><br>webtrees может автоматически отправлять электронную почту для уведомления администратора об изменениях, которые должны быть просмотрены. webtrees также отправляет уведомления по электронной почте для пользователей, которые начали регистрацию.<br><br>Как правило, в поле "От:" ("From:") для автоматически созданных сообщений указывается строка, вида <i>From: webtrees-noreply@yoursite</i>. Эта строка сообщает, чтобы Вы не отвечали на это сообщение. Для защиты от спама и других нарушений, некоторые системы электронной почты, требуют от каждого сообщения, правильный адрес электронной почты в поле "От:" ("From:"). Эти системы, не доставят вам сообщения, отправленные с учетной записи <i>webtrees-noreply</i>.',
