  'If a visitor to the website has not selected a preferred language in their browser preferences, or they have selected an unsupported language, then this language will be used. Typically this applies to search engines.' => 'Если посетитель сайта не указан предпочитаемый язык в настройки своего браузера, или он указал неподдерживаемый язык, то будет использоваться этот язык. Как правило, этот параметр применяется для поисковых систем.',
  'If an administrator creates a user account, the verification email is not sent, and the email must be verified manually.' => 'Если администратор создаёт сам учетную запись, проверочное письмо не посылается на почту пользователя, а почта подтверждается вручную.',
  'If an individual does not have a surname, no slashes are needed: <%s>Jón Einarsson<%s>' => 'Если человек не имеет фамилию, ни одной косой черты не потребуются: <%s>Jón Einarsson<%s>',
  'If an individual has two separate surnames, both should be enclosed by slashes: <%s>José Antonio /Gómez/ /Iglesias/<%s>' => 'Если человек имеет две отдельные фамилии, обе должны быть заключены в косые черты: <%s>José Antonio /Gómez/ /Iglesias/<%s>',
  'If an individual was known by a nickname which is not part of their formal name, it should be enclosed by quotation marks. For example, <%s>John &quot;Nobby&quot; /Clark/<%s>.' => 'Если человек был известен под прозвищем, которое не является частью его официального имени, его необходимо заключить в кавычки. Например, <%s>John &quot;Nobby&quot; /Clark/<%s>.',
  'If an individual was not known by their first given name, the preferred name should be indicated with an asterisk: <%s>John Paul* /Smith/<%s>' => 'Если у персоны было несколько имен, но только одно было общеизвестным, то это имя может быть указанно звездочкой: <%s>Анна Мария* /Иванова/<%s>',
  'If the surname is unknown, use empty slashes: <%s>Mary //<%s>' => 'Если фамилия неизвестна, используйте пустые косые черты: <%s>Мария //<%s>',
  'If this individual has any events other than death, burial, or cremation more recent than this number of years, they are considered to be “alive”. Children’s birth dates are considered to be such events for this purpose.' => 'Если с этим человеком связаны какие-либо события кроме смерти, похоронами или кремации, которые произошли позже, чем это число лет, он будет признан «живым». Для целей расчета за такое событие считается также рождение ребенка.',
  'If two family trees use the same media folder, then they will be able to share media files. If they use different media folders, then their media files will be kept separate.' => 'Если два генеалогического дерева используют один и тот же каталог, то они могут разделять одни и те же файлы мультимедиа. А если деревья используют разные каталоги для хранения мультимедиа, то данные будут храниться отдельно.',
  'If visitors can not see the family tree, they will not be able to sign up for an account. You will need to add their account manually.' => 'Если посетители не смогут видеть семейное дерево, они не смогут зарегистрировать свою учетную запись. Вам придется добавлять их учетную запись вручную.',
  'If you are concerned that users might upload inappropriate images, you can restrict media uploads to managers only.' => 'Если Вы боитесь, что пользователи будут загружать несоответствующие картинки, то загрузку можно разрешить только администраторам.',
  'If you are the website administrator, you should check that:' => 'Если Вы администратор сайта, Вы должны проверить это:',
  'If you cannot resolve the problem yourself, you can ask for help on the forums at <a href="https://webtrees.net">webtrees.net</a>.' => 'Если Вы сами не можете решить проблему, Вы можете спросить на форуме <a href="https://webtrees.net">webtrees.net</a>.',
  'If you created this GEDCOM file using genealogy software that omits spaces when splitting long lines, then select this option to reinsert the missing spaces.' => 'Если Вы создали этот файл, используя генеалогическое программное обеспечение GEDCOM, которое опускает пробелы при разделении длинных строк, то выберите эту опцию, чтобы вставить недостающие пробелы.',
  'If you didn’t request an account, you can just delete this message.' => '<br><br>Если Вы не делали запрос на доступ, то удалите это сообщение.',
  'If you have a large number of inactive places, it can be slow to generate the list.' => 'Если у Вас большое количество неиспользуемых мест, то список будет долго создаваться.',
  'If you have a large number of media files, you can organize them into folders and subfolders.' => 'Если у Вас есть большое количество медиафайлов, Вы можете организовать их в папки и подпапки.',
  'If you have created media objects in webtrees, and have subsequently edited this GEDCOM file using genealogy software that deletes media objects, then select this option to merge the current media objects with the new GEDCOM file.' => 'Если Вы создали медиаобъекты в Webtrees, но ввели изменения в этот файл GEDCOM используя программу которая удаляет медиаобъекты, то выберите этот параметр, чтобы объединить существующие медиаобъекты с новым файлом GEDCOM.',
  'If you hide an empty block, you will not be able to change its configuration until it becomes visible by no longer being empty.' => 'Если блок не будет виден, Вы не сможете изменить настройки.',
  'If you select a different folder, you must also move all files (except config.ini.php, index.php, and .htaccess) from the existing folder to the new folder.' => 'При выборе другой папки, необходимо также переместить все файлы (кроме config.ini.php, index.php и .htaccess) из существующей в новую папку.',
  'If you select a different folder, you must also move any media files from the existing folder to the new one.' => 'При выборе другой папки необходимо перемещать любые медиафайлы из существующей папки в новую.',
  'If you show living individuals to visitors, all other privacy restrictions are ignored. Do this only if all the data in your tree is public.' => 'Если Вы покажете живущих людей для посетителей, все другие ограничения конфиденциальности игнорируются. Сделайте это, только если все данные в Вашем дереве является общедоступными.',
  'If you try to exceed these limits, you may experience server time-outs and blank pages.' => 'Превышение этих требований может выводить на экран пустые(чистые) страницы и перебои в работе скриптов.',
  'If you use one of the following tracking and analytics services, webtrees can add the tracking codes automatically.' => 'Webtrees может автоматически добавлять коды отслеживания, если Вы используете один из следующих услуг отслеживания и аналитики.',
  'If your server’s security policy permits it, you will be able to request increased memory or CPU time using the webtrees administration page. Otherwise, you will need to contact your server’s administrator.' => 'Если политика безопасности Вашего сервера это позволяет, Вы сможете увеличить память или время процессора, используя страницу администрирования webtrees . В противном случае Вам нужно будет связаться с администратором Вашего сервера.',
  'If your website can be reached using more than one URL, such as <b>http://www.example.com/webtrees/</b> and <b>http://webtrees.example.com/</b>, you can specify the preferred URL. Requests for the other URLs will be redirected to the preferred one.' => 'Если Ваш сайт может быть недоступен при использовании более чем одного URL-адреса, например, <b>http://www.example.com/webtrees/</b> или <b>http://webtrees.example.com/</b>, можно указать адрес URL. Запроса URL-адреса будут переадресованы на нужный адрес.',
  'Image dimensions' => 'Размеры картинки',
  'Images without watermarks' => 'Без водяных знаков',
  'Immigration' => 'Иммиграция',
  'Import' => 'Загрузить',
  'Import a GEDCOM file' => 'Импорт (загрузить) файла GEDCOM',
  'Import all places from a family tree' => 'Импортировать все места из дерева',
  'Import preferences' => 'Параметры импорта',
  'In a family tree, each record has an internal reference number (called an “XREF”) such as “F123” or “R14”.' => 'В генеалогическом дереве, каждая запись имеет внутренний номер для ссылок (так называемый «XREF»), такие как «F123» или «R14».',
  'In many cultures it is customary to have a traditional name spelled in the traditional characters and also a romanized version of the name as it would be spelled or pronounced in languages based on the Latin alphabet, such as English.<br><br>If you prefer to use a non-Latin alphabet such as Hebrew, Greek, Russian, Chinese, or Arabic to enter the name in the standard name fields, then you can use this field to enter the same name using the Latin alphabet. Both versions of the name will appear in lists and charts.<br><br>Although this field is labeled “Romanized”, it is not restricted to containing only characters based on the Latin alphabet. This might be of use with Japanese names, where three different alphabets may occur.' => 'Во многих культурах, как правило, записывают имя и фамилию с помощью традиционных символов, а его латинизированную версию так, как оно пишется и произносится в языках, основанных на латинице, таких как английский.<br><br>Если Вы предпочитаете вводить свои данные не на латинском алфавите, а на таких как иврит, греческий, русский, китайский или арабский, то Вы можете использовать это поле для ввода тех же данных при помощи латинского алфавита. На графиках и диаграммах будут доступны обе версии.<br><br>Название этого поля не ограничивается тоько символами латинского алфавита. Это может быть полезно, например, для японских имен, которые могут возникнуть, в трех алфавитах.',
  'In many cultures it is customary to have a traditional name spelled in the traditional characters and also a romanized version of the name as it would be spelled or pronounced in languages based on the Latin alphabet, such as English.<br><br>If you prefer to use the Latin alphabet to enter the name in the standard name fields, then you can use this field to enter the same name in the non-Latin alphabet such as Greek, Hebrew, Russian, Arabic, or Chinese. Both versions of the name will appear in lists and charts.<br><br>Although this field is labeled “Hebrew”, it is not restricted to containing only Hebrew characters.' => 'Во многих культурах, как правило, записывают имя и фамилию с помощью традиционных символов, а его латинизированную версию так, как оно пишется и произносится в языках, основанных на латинице, таких как английский.<br><br>Если Вы предпочитаете вводить свои данные на латинском алфавите, и на таких как иврит, греческий, русский, китайский или арабский, то Вы можете использовать это поле для ввода тех же данных при помощи латинского алфавита. На графиках и диаграммах будут доступны обе версии.<br><br>Хотя это поле обозначено «иврит», он не ограничивается, содержащий только символы иврита.',
  'In some calendars, days start at midnight. In other calendars, days start at sunset. The conversion process does not take account of the time, so for any event that occurs between sunset and midnight, the conversion between these types of calendar will be one day out.' => 'В некоторых календарях, дни начинаются в полночь. В других календарей, дни начнаются на закате. Процесс преобразования не учитывает время, также для любого события, которое происходит между закатом и полночью, преобразования между этими типами календаря будет один из днём.',
  'In some countries, privacy laws apply not only to living individuals, but also to those who have died recently. This option will allow you to extend the privacy rules for living individuals to those who were born or died within a specified number of years. Leave these values empty to disable this feature.' => 'В некоторых странах законы о конфиденциальности применяются не только для живых людей, но также для тех, кто недавно умер. Этот параметр позволит Вам расширить правила конфиденциальности для жизни людей, для тех, кто родился или умер в течение определенного количества лет. Оставьте эти значения пустыми, чтобы отключить этот параметр.',
