  'Places in %s' => 'Места в %s',
  'Places should be entered according to the standards for genealogy. In genealogy, places are recorded with the most specific information about the place first and then working up to the least specific place last, using commas to separate the different place levels. The level at which you record the place information should represent the levels of government or church where vital records for that place are kept.<br><br>For example, a place like Salt Lake City would be entered as “Salt Lake City, Salt Lake, Utah, USA”.<br><br>Let’s examine each part of this place. The first part, “Salt Lake City,” is the city or township where the event occurred. In some countries, there may be municipalities or districts inside a city which are important to note. In that case, they should come before the city. The next part, “Salt Lake,” is the county. “Utah” is the state, and “USA” is the country. It is important to note each place because genealogy records are kept by the governments of each level.<br><br>If a level of the place is unknown, you should leave a space between the commas. Suppose, in the example above, you didn’t know the county for Salt Lake City. You should then record it like this: “Salt Lake City, , Utah, USA”. Suppose you only know that an individual was born in Utah. You would enter the information like this: “, , Utah, USA”. <br><br>You can use the <b>Find Place</b> link to help you find places that already exist in the database.' => 'Места вводится в соответствии со стандартами, принятыми в генеалогии. В генеалогии, местонахождение мест сохраняются, поместив наиболее подробную информацию в начале, а затем, предоставляя данные, все более и более общие, при этом разделяя уровни запятыми. Уровни информации о местоположении должны отражать уровни управленческой иерархии, или церкви, в которой хранятся файлы.<br><br>Например, место, как Солт-Лейк-Сити, будут введены как «Солт-Лейк-Сити, Солт-Лейк, Юта, США».<br><br>Давайте рассмотрим каждую часть этого места. Первая часть, «Солт-Лейк-Сити,» является город или поселок, где произошло событие. В некоторых странах, могут быть муниципалитеты и районы внутри города, который важно отметить. В этом случае, они должны указываться до имени города. Следующая часть, «Солт-Лейк» - это графство. «Юта» - является штатом, а «США» - это страна. Важно отметить каждое местоположение, потому что генеалогические записи хранятся у правительств каждого уровня.<br><br>Если нет информации на каком-то уровне, можно оставить свободное место между запятыми. Предположим, в примере выше, Вы не знаете округа для Солт-Лейк-Сити. Вы должны записать это так: «Солт-Лейк-Сити, , Юта, США». Предположим, Вы только знаете, что человек родился в штате Юта. Вы должны ввести информацию вроде этой: «, , Юта, США».<br><br>Вы можете использовать ссвлку <b>найти место</b>, чтобы помочь Вам найти местоположение, которые уже существуют в базе данных.',
