  'The <b>name</b> field contains the individual’s full name, as they would have spelled it or as it was recorded. This is how it will be displayed on screen. It uses standard genealogy annotations to identify different parts of the name.' => '<b>имя</b> поле содержит индивидуальные полное имя, как пишется или как он был записан. Вот как это будет отображаться на экране. Он использует стандартные генеалогическое аннотации для выявления различных частей имени.',
  'The <b>surname</b> field contains a name that is used for sorting and grouping. It can be different to the individual’s actual surname which is always taken from the <b>name</b> field. This field can be used to sort surnames with or without a prefix (Gogh / van Gogh) and to group spelling variations or inflections (Kowalski / Kowalska). If an individual needs to be listed under more than one surname, each name should be separated by a comma.' => '<b>фамилия</b> поле содержит имя, которое используется для сортировки и группировки. Он может быть различным для отдельных фактических фамилия, которая всегда берется из <b>имя</b> поле. Это поле может использоваться для сортировки фамилий с или без префикса (Gogh / van Gogh) и группы вариантов написания, или флексии (Kowalski / Ковальской). Если человек должен находиться в списке более одной фамилии, имя каждого должны быть разделены запятой.',
  'The GEDCOM file “%s” has been imported.' => 'Файл GEDCOM “%s” был импортирован (загружен).',
  'The Hague, Netherlands' => 'Гаага, Нидерланды',
  'The PHP temporary folder is missing.' => 'Отсутствует папка для временных PHP файлов.',
  'The PhpGedView to webtrees wizard is an automated process to assist administrators make the move from a PhpGedView installation to a new webtrees one. It will transfer all PhpGedView GEDCOM and other database information directly to your new webtrees database. The following requirements are necessary:' => 'Мастер переноса PhpGedView в Webtrees представляет собой автоматизированный процесс, который поможет администраторам сделать переход PhpGedView к новой системе Webtrees. Это позволит переместить все файлы GEDCOM и другой информации, содержащейся в базе данных PhpGedView непосредственно в новую базу данных Webtrees. Необходимы следующие параметры:',
  'The administrator at the webtrees site %s has approved your application for an account. You may now sign in by accessing the following link: %s' => 'Администратор сайта %s одобрил Вашу заявку на регистрацию учетной записи. Теперь Вы можете войти, используя следующую ссылку: %s',
  'The administrator has been informed. As soon as they give you permission to sign in, you can sign in with your username and password.' => 'Администратор был проинформирован. Как только он даст разрешение на вход в систему, Вы можете войти, используя имя пользователя и пароль.',
  'The changes to “%s” have been accepted.' => 'Изменения для «%s» приняты.',
  'The changes to “%s” have been rejected.' => 'Изменения для «%s» отклонены.',
  'The clippings cart allows you to take extracts from this family tree and download them as a GEDCOM file.' => 'Корзина вырезок позволяет извлекать вырезки (выдержки) из этого генеалогического дерева и соединить их в один файл для загрузки и последующего импорта в Вашу собственную генеалогически программу. Загружаемый файл записывается в формате GEDCOM.<br><ul><li>Как сделать вырезку?<br> Это очень просто. Каждый раз, когда Вы видите имя (персон, семьи или источники), на которое можно нажать, перейдите на страницу с подробностями для этого имени. Там Вы увидите ссылки <b>Добавить в корзину вырезок</b>. Когда Вы перейдете по этой ссылке, Вам будет предложено несколько вариантов для загрузки.</li <li>Как загружать?<br>Когда в корзине будут все нужные Вам вырезки, Вы можете скачать их просто нажав на ссылку "Скачать". Затем следуйте инструкциям и ссылкам.</li></ul>',
