  'The media file was not found in this family tree.' => 'Этот медиафайл не найден в данном семейном дереве.',
  'The media file you are uploading can be, and probably should be, named differently on the server than it is on your local computer. This is so because often the local filename has meaning to you but is much less meaningful to others visiting this website. Consider also the possibility that you and someone else both try to upload different files called “granny.jpg“.<br><br>In this field, you specify the new name of the file you are uploading. The name you enter here will also be used to name the thumbnail, which can be uploaded separately or generated automatically. You do not need to enter the filename extension (jpg, gif, pdf, doc, etc.)<br><br>Leave this field blank to keep the original name of the file you have uploaded from your local computer.' => 'Медиафайл, который вы загружаете, может быть, и, вероятно, должен быть назван по-разному на сервере, чем на локальном компьютере. Это так, потому что часто местные filename имеет для вас значение, но гораздо менее значимым для других людей, посещающих этот сайт. Рассмотрите также возможность того, что вы и кто-то еще как попробуйте загрузить разные файлы под названием «бабушка.jpg«.<br><br>В этом поле необходимо указать новое имя файла, который вы загружаете. Имя, которое Вы введете здесь, будет также использоваться, чтобы назвать миниатюры, которые могут быть загружены отдельно или автоматически. Вам не нужно вводить расширение файла (jpg, gif, pdf, doc, etc.)<br><br>Оставьте это поле пустым, чтобы сохранить оригинальное имя файла, который вы загрузили с локального компьютера.',
  'The memory and CPU time requirements depend on the number of individuals in your family tree.' => 'Требования к процессору и памяти зависят от количества людей в вашем генеалогическом дереве.',
