  'The username or password is incorrect.' => 'Неправильное имя пользователя или пароль.',
  'The username required for authentication with the SMTP server.' => 'Имя пользователя, необходимое для аутентификации с SMTP сервером .',
  'The value to place in the “meta description” tag in the HTML page header. Leave this field empty to use the name of the family tree.' => 'Значение, место в «Мета описание» тег в HTML-заголовке страницы. Оставьте это поле пустым, чтобы использовать имя генеалогическое дерево.',
  'The version of %s is too new.' => 'Версия %s слишком новая.',
  'The version of %s is too old.' => 'Версия %s слишком старая.',
  'The website access rule has been created.' => 'Правило доступа к веб-сайту был создан.',
  'The website access rule has been deleted.' => 'Правило доступа к сайту было удалено.',
  'The website access rule has been updated.' => 'Правило доступа к сайту было обновлено.',
  'The website preferences have been updated.' => 'Предпочтения сайта были обновлены.',
  'The website www.geonames.org provides a large database of place names. This can be searched when entering new places. To use this feature, you must register for a free account at www.geonames.org and provide the username.' => 'Сайт www.geonames.org предоставляет большую базу данных географических данных. Это может быть поиск при вводе новых мест. Для использования этой функции необходимо зарегистрировать бесплатный аккаунт на www.geonames.org и указать имя пользователя.',
  'The webtrees developers would be very interested to learn about this error. If you contact them, they will help you resolve the problem.' => 'Разработчикам webtrees было бы очень интересно узнать об этой ошибке. Если Вы свяжитесь с ними, они помогут Вам решить проблему.',
  'The “%” character is a wildcard, and will match zero or more other characters.' => 'Символ “%” является подстановочным знаком и будет соответствовать нулю или других знаков.',
  'Theme' => 'Тема',
  'Theme change' => 'Выбор темы',
  'Theme menu' => 'Выбор темы',
  'Themes' => 'Темы',
  'Themes can be selected at three levels: user, family tree, and website. User preferences take priority over family tree preferences, which in turn take priority over the website preferences. Selecting “default theme” at one level will use the theme at the next level.' => 'Темы могут быть выбраны на трех уровнях: пользователя, генеалогическое дерево и веб-сайт. Пользовательские настройки имеют приоритет над настройками деревьев семьи, которые, в свою очередь, имеют приоритет над настройками веб-сайта. Выбрав "тему по умолчанию" на одном уровне, эта тема будет использоваться на следующем уровне.',
  'There are no facts for this individual.' => 'Для этой персоны нету фактов.',
  'There are no media objects for this individual.' => 'Для этой персоны нет медиаобъектов.',
  'There are no notes for this individual.' => 'Для этой персоны нет примечаний.',
  'There are no pending changes.' => 'Нет отложенных изменений.',
  'There are no research tasks in this family tree.' => 'В этом генеалогическом дереве нет заданий для уточнения.',
  'There are no source citations for this individual.' => 'Для этой персоны нет источников цитирования.',
  'There are pending changes for you to moderate.' => 'Есть ожидающие изменения для модерирования.',
  'There have been no changes within the last %s day.' . "\0" . 'There have been no changes within the last %s days.' => 'За последний день не было никаких изменений.' . "\0" . 'За последние %s дня не было никаких изменений.' . "\0" . 'За последние %s дней не было никаких изменений.',
  'There is no account with the username or email “%s”.' => 'Нет аккаунта с этим именем пользователя или адресом электронной почты “%s”.',
  'There was an error uploading your file.' => 'Ошибка при загрузке файла.',
  'These groups of individuals are not related to %s.' => 'Эти группы персон не связаны с %s.',
  'These pages provide access to all the preferences and management tools for this webtrees site.' => 'Эти страницы предоставляют доступ ко всем настройкам конфигурации и управления инструментов для этого webtrees сайта.',
  'This GEDCOM file is encoded using %1$s. Assume this to mean %2$s.' => 'Этот файл GEDCOM закодирован с помощью %1$s. Предположим, что это означает %2$s.',
  'This account has not been approved. Please wait for an administrator to approve it.' => 'Эта учетная запись не была утверждена. Пожалуйста, подождите, пока администратор её одобрит.',
  'This account has not been verified. Please check your email for a verification message.' => 'Адрес электронной почты для этой учетной записи не был подтвержден. Пожалуйста, войдите в свою электронную почту и откройте письмо с заголовком "Ваша регистрация на <em>(имя сайта)</em>", затем перейдите по ссылке, указанной в теле письма.',
  'This block will show editors a list of records with pending changes that need to be reviewed by a moderator. It also generates daily emails to moderators whenever pending changes exist.' => 'Этот блок будет показывать редакторам список записей с текущими изменениями, которые должны быть одобрены модератором. Он также создает ежедневные электронные письма модераторам, когда существуют отложенные изменения.',
  'This database and table-prefix appear to be used by another application. If you have an existing PhpGedView system, you should create a new webtrees system. You can import your PhpGedView data and settings later.' => 'Эта база данных и префикс таблиц используется другим приложением. Если у Вас уже есть система PhpGedView, Вы должны создать новую систему webtrees. Позже Вы можете импортировать данные и настройки PhpGedView.',
  'This database is only running MySQL version %s. You cannot install webtrees here.' => 'Эта база данных работает только с MySQL версии %s. Вы не можете установить здесь webtrees.',
  'This email address will be used to send password reminders, website notifications, and messages from other family members who are registered on the website.' => 'Этот адрес будет использоваться для отправки Вам напоминания пароля, уведомления и сообщения сайта, а также от других членов семьи или пользователей, зарегистрированных на этом сайте.',
  'This entry is ignored if you have entered a URL into the filename field.' => 'Эта запись игнорируется, если ввели URL в поле имени файла.',
  'This family does not exist or you do not have permission to view it.' => 'Эта семья не существует или у Вас нет прав для просмотра.',
  'This family has been deleted. The deletion will need to be reviewed by a moderator.' => 'Эта семья была удалена. Удаление должны быть проверено модератором.',
  'This family has been deleted. You should review the deletion and then %1$s or %2$s it.' => 'Эта семья была удалена. Вы должны пересмотреть это удаление, а затем %1$s или %2$s его.',
  'This family has been edited. The changes need to be reviewed by a moderator.' => 'Эта семья была отредактирована. Изменения должны быть проверены модератором.',
  'This family has been edited. You should review the changes and then %1$s or %2$s them.' => 'Эта семья была отредактирована. Вы должны рассмотреть это изменение, а затем %1$s или %2$s его.',
  'This family remained childless' => 'Эта семья осталась бездетной',
  'This family tree has %s record which uses the same “XREF” as another family tree.' . "\0" . 'This family tree has %s records which use the same “XREF” as another family tree.' => 'Это семейное дерево имеет %s запись, которая использует ту же «XREF» как и еще одно семейное дерево.' . "\0" . 'Это семейное дерево имеет %s записи, которые используют ту же «XREF» как и еще одно семейное дерево.' . "\0" . 'Это семейное дерево имеет %s записей, которые используют ту же «XREF» как и еще одно семейное дерево.',
  'This family tree has no images to display.' => 'Это генеалогическое дерево не имеет картинки для показа.',
  'This family tree was last updated on #gedcomUpdated#. There are #totalSurnames# surnames in this family tree. The earliest recorded event is the #firstEventType# of #firstEventName# in #firstEventYear#. The most recent event is the #lastEventType# of #lastEventName# in #lastEventYear#.<br><br>If you have any comments or feedback please contact #contactWebmaster#.' => 'Последнее обновление этого фамильного дерева было #gedcomUpdated#. #totalSurnames# фамилий в этом дереве. Раннее событие #firstEventType# из #firstEventName# в #firstEventYear#. Самое последнее событие - это #lastEventType# из #lastEventName# в #lastEventYear#.<br><br>Если у Вас есть какие-либо комментарии или предложения, пожалуйста, свяжитесь с #contactWebmaster#.',
  'This family tree was last updated on %s.' => 'Это генеалогическое дерево было обновлено последний раз %s.',
  'This file is linked to another family tree on this server. It cannot be deleted, moved, or renamed until these links have been removed.' => 'Этот файл связан с другим семейным деревом на этом сервере. Он не может быть удален, перемещен или переименован, пока эта связь не будет удалена.',
  'This folder will be used by webtrees to store media files, GEDCOM files, temporary files, etc. These files may contain private data, and should not be made available over the internet.' => 'Эта папка будет использоваться Webtrees для хранения медиафайлов, файлов GEDCOM, временные файлы и др. Эти файлы могут содержать личные данные, и не должны быть доступны через интернет.',
  'This folder will be used to store the media files for this family tree.' => 'Эта папка будет использоваться для хранения медиафайлов для этой родословной.',
  'This form has expired. Try again.' => 'Время для этой формы истекло. Попробуйте еще раз.',
  'This individual does not exist or you do not have permission to view it.' => 'Данных о запрашиваемой персоне нет или у Вас нет прав для просмотра.',
  'This individual has been deleted. The deletion will need to be reviewed by a moderator.' => 'Этот человек был удален. Удаление должно быть проверено модератором.',
  'This individual has been deleted. You should review the deletion and then %1$s or %2$s it.' => 'Этот человек был удалён. Вы должны пересмотреть это удаление, а затем %1$s или %2$s его.',
  'This individual has been edited. The changes need to be reviewed by a moderator.' => 'Этот человек был отредактирован. Изменения должны быть проверены модератором.',
  'This individual has been edited. You should review the changes and then %1$s or %2$s them.' => 'Этот человек был отредактирован. Вы должны рассмотреть это изменение, а затем %1$s или %2$s его.',
  'This individual will be selected by default when viewing charts and reports.' => 'Эта персона будет выбрана по умолчанию при просмотре графиков и отчетов.',
  'This information is private and cannot be shown.' => 'Детальные сведения являются личными.',
  'This input box lets you change that year of the calendar. Type a year into the box and press <b>Enter</b> to change the calendar to that year.<br><br><b>Advanced features</b> for <b>View the year</b><dl><dt><b>More than one year</b></dt><dd>You can search for dates in a range of years.<br><br>Year ranges are <u>inclusive</u>. This means that the date range extends from 1 January of the first year of the range to 31 December of the last year mentioned. Here are a few examples of year ranges:<br><br><b>1992-5</b> for all events from 1992 to 1995.<br><b>1972-89</b> for all events from 1972 to 1989.<br><b>1610-759</b> for all events from 1610 to 1759.<br><b>1880-1905</b> for all events from 1880 to 1905.<br><b>880-1105</b> for all events from 880 to 1105.<br><br>To see all the events in a given decade or century, you can use <b>?</b> in place of the final digits. For example, <b>197?</b> for all events from 1970 to 1979 or <b>16??</b> for all events from 1600 to 1699.<br><br>Selecting a range of years will change the calendar to the year view.</dd></dl>' => 'В этом поле ввода можно изменить календарный год. Введите год в поле и нажмите <b>Enter</b>, чтобы изменить календарный год.<br><br><b>дополнительные функции</b> - <b>вид год</b><dl><dt><b>более чем на один год</b></dt><dd>Вы можете искать для дат в диапазоне лет.<br><br>Год диапазонов <u>включительно</u>. Это означает, что дата в диапазоне от 1 января первого года в диапазоне до 31 декабря прошлого года говорил. Вот несколько примеров году диапазоны:<br><br><b>1992-5</b> для всех событий с 1992 по 1995 год.<br><b>1972-89</b> для всех событий с 1972 по 1989 год.<br><b>1610-759</b> для всех событий от 1610 до 1759 года.<br><b>1880-1905</b> для всех событий с 1880 по 1905 г.<br><b>880-1105</b> для всех событий от 880 до 1105.<br><br>Чтобы увидеть все события в данной десятилетия или века, вы можете использовать <b>?</b> в место последней цифры. Например, <b>197?</b> для всех событий с 1970 по 1979 или <b>16??</b> для всех событий с 1600 по 1699.<br><br>Выбирая из целого ряда лет будут изменения календаря на год вид.</dd></dl>',
  'This is a comma separated list of GEDCOM fact tags that will be shown on the add/edit name form. If you use non-Latin alphabets such as Hebrew, Greek, Cyrillic, or Arabic, you may want to add tags such as _HEB, ROMN, FONE, etc. to allow you to store names in several different alphabets.' => 'Это разделенный запятыми список тегов GEDCOM фактов, которые будут отображаться в форме добавления/редактирования имени. При использовании не латинских алфавитов, таких как иврит, греческий, кириллица, арабский, Вы можете добавить такие теги, как _HEB, ROMN, FONE, и т.д. чтобы Вы могли хранить имена в нескольких разных алфавитах.',
  'This is a comma separated list of GEDCOM fact tags that will be shown when adding a new family. For example, if MARR is in the list, then fields for marriage date and marriage place will be shown on the form.' => 'Этот разделенный запятыми список тегов GEDCOM фактов, которые будет показаны при добавлении новой семьи. Например, если MARR находится в списке, то поля для даты вступления и место брака будут показаны в форме.',
  'This is a comma separated list of GEDCOM fact tags that will be shown when adding a new individual. For example, if BIRT is in the list, fields for birth date and birth place will be shown on the form.' => 'Это разделенный запятыми список тегов GEDCOM фактов, которые будут отражены при добавлении нового лица. Например, если BIRT находится в списке, то поля для даты и место рождения будут отображаться в форме.',
  'This is a comma separated list of GEDCOM fact tags that will be shown when you add or edit place names. If you use non-Latin alphabets such as Hebrew, Greek, Cyrillic, or Arabic, you may want to add tags such as _HEB, ROMN, FONE, etc. to allow you to store place names in several different alphabets.' => 'Это разделенный запятыми список тегов GEDCOM фактов, которые будут показаны при добавлении или редактировании названий мест. Если Вы используете не латинский алфавит, такой как иврит, греческий, кириллица, арабский, Вы возможно захотите добавить такие теги, как _HEB, ROMN, FONE, и т.д. чтобы позволить сохранять названия мест в нескольких различных алфавитах.',
  'This is a link to your own record in the family tree. If this is the wrong individual, contact an administrator.' => 'Это ссылка на запись в Вашем семейном дереве. Если это неправильная персона, обратитесь к администратору.',
  'This is a summary of the <abbr title="The Church of Jesus Christ of Latter-day Saints">LDS</abbr> ordinances for the individual. “B” indicates an LDS baptism. “E” indicates an LDS endowment. “S” indicates an LDS spouse sealing. “P” indicates an LDS child-to-parent sealing.' => 'Это краткая информация о <abbr title="Церковь Иисуса Христа Святых последних дней">LDS</abbr> таинств для человека. «B» означает крещение LDS. «E» означает облечение LDS. 
"S" указывает на супружеское запечатывание LDS. "Р" указывает на запечатывание ребенка к родителю LDS.',
  'This is case sensitive.' => 'С учётом регистра.',
  'This is case sensitive. If a database with this name does not already exist webtrees will attempt to create one for you. Success will depend on permissions set for your web server, but you will be notified if this fails.' => 'С учетом регистра. Если база данных не существует, webtrees попытается создать её для Вас. Успех зависит от прав выделенные Вашему серверу. Вы будете оповещены о результате.',
  'This is the initial value for the “show details” option on the charts.' => 'Это начальная настройка для параметра «показать подробности» на диаграммах.',
  'This is the latest version of webtrees. No upgrade is available.' => 'Это последняя версия webtrees. Обновление не требуется.',
  'This is the list of GEDCOM facts that your users can add to families. You can modify this list by removing or adding fact names, even custom ones, as necessary. Fact names that appear in this list must not also appear in the “Unique family facts” list.' => 'Это список фактов GEDCOM, которые Ваши пользователи могут добавлять в семьи. Вы можете изменить этот список, добавив или удалив названия фактов (даже нестандартные, если это необходимо). Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the list of GEDCOM facts that your users can add to individuals. You can modify this list by removing or adding fact names, even custom ones, as necessary. Fact names that appear in this list must not also appear in the “Unique individual facts” list.' => 'Это список фактов GEDCOM, которые Ваши пользователи могут добавлять к людям. Вы можете изменить этот список, добавив или удалив названия фактов (даже нестандартные, если это необходимо). Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the list of GEDCOM facts that your users can add to repositories. You can modify this list by removing or adding fact names, even custom ones, as necessary. Fact names that appear in this list must not also appear in the “Unique repository facts” list.' => 'Это список фактов GEDCOM, которые Ваши пользователи могут добавлять в хранилища (репозитории). Вы можете изменить этот список, добавив или удалив названия фактов (даже нестандартные, если это необходимо). Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the list of GEDCOM facts that your users can add to sources. You can modify this list by removing or adding fact names, even custom ones, as necessary. Fact names that appear in this list must not also appear in the “Unique source facts” list.' => 'Это список фактов GEDCOM, которые Ваши пользователи могут добавлять к источникам. Вы можете изменить этот список, добавив или удалив названия фактов (даже нестандартные, если это необходимо). Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the list of GEDCOM facts that your users can only add once to families. For example, if MARR is in this list, users will not be able to add more than one MARR record to a family. Fact names that appear in this list must not also appear in the “All family facts” list.' => 'Это список фактов GEDCOM, которые Ваши пользователи могут добавлять к семьям только один раз. Например, если MARR находится в этом списке, то пользователи не смогут добавлять больше чем одну запись MARR к семье. Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the list of GEDCOM facts that your users can only add once to individuals. For example, if BIRT is in this list, users will not be able to add more than one BIRT record to an individual. Fact names that appear in this list must not also appear in the “All individual facts” list.' => 'Это список фактов GEDCOM, которые Ваши пользователи могут добавлять к лицам только один раз. Например, если BIRT находится в этом списке, то пользователи не смогут добавить больше чем одну запись BIRT к лицу. Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the list of GEDCOM facts that your users can only add once to repositories. For example, if NAME is in this list, users will not be able to add more than one NAME record to a repository. Fact names that appear in this list must not also appear in the “All repository facts” list.' => 'Это список фактов GEDCOM, которые пользователи могут добавлять в хранилище (репозиторий) только один раз. Например, если имя есть в этом списке, то пользователи не смогут добавить больше чем одну запись NAME в хранилище (репозиторий). Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the list of GEDCOM facts that your users can only add once to sources. For example, if TITL is in this list, users will not be able to add more than one TITL record to a source. Fact names that appear in this list must not also appear in the “All source facts” list.' => 'Это список фактов GEDCOM, которые пользователи могут добавить к источникам только один раз. Например, если TITL находится в этом списке, пользователи не смогут добавлять более одной записи TITL к источнику. Названия фактов, которые появляются в этом списке, также не должны присутствовать в списке «Уникальные семейные факты».',
  'This is the name of the SMTP server. “localhost” means that the mail service is running on the same computer as your web server.' => 'Это имя SMTP-сервера. \'localhost\' означает, что почтовая служба запущена на том же компьютере, что и Ваш веб-сервер.',
  'This is the width (in pixels) that the program will use when automatically generating thumbnails. The default value is 100.' => 'Это ширина (в пикселях), которые программа будет использовать при автоматической генерации миниатюр. Значение по умолчанию 100.',
  'This is your real name, as you would like it displayed on screen.' => 'Ваше настоящее имя, которое будет отображаться на экране.',
  'This may be a mistake in your data.' => 'Это может быть ошибкой в Ваших данных.',
  'This may cause a problem for other applications.' => 'Это может привести к проблеме с другими программами.',
  'This may cause a problem for webtrees.' => 'Это может привести к проблемме с webtrees.',
  'This media file does not exist.' => 'Этот медиафайл не существует.',
  'This media file exists, but cannot be accessed.' => 'Этот мультимедийный файл существует, но недоступен.',
  'This media file is broken and cannot be watermarked.' => 'Этот медиафайл поврежден и не может быть с водяными знаками.',
  'This media object does not exist or you do not have permission to view it.' => 'Этот медиаобъект не существует или у Вас нет прав для просмотра.',
  'This media object has been deleted. The deletion will need to be reviewed by a moderator.' => 'Этот медиаобъект был удален. Удаление должно быть проверено модератором.',
  'This media object has been deleted. You should review the deletion and then %1$s or %2$s it.' => 'Этот медиаобъект был удален. Вы должны пересмотреть это удаление, а затем %1$s или %2$s его.',
  'This media object has been edited. The changes need to be reviewed by a moderator.' => 'Этот медиаобъект был отредактирован. Изменения должны быть проверены модератором.',
  'This media object has been edited. You should review the changes and then %1$s or %2$s them.' => 'Этот медиаобъект был отредактирован. Вы должны рассмотреть это изменение, а затем %1$s или %2$s его.',
  'This media object is not linked to any other record.' => 'Этот медиа-объект не связан с какой либо записью.',
  'This message was sent while viewing the following URL: ' => 'Сообщение послано со следующего URL: ',
  'This message will be sent to %s' => 'Кому: %s',
  'This must be at least six characters long. It is case-sensitive.' => 'Должно быть не менее шести символов с учетом регистра.',
  'This name is used in the “From” field, when sending automatic emails from this server.' => 'Это имя используется в поле «От кого», при отправки автоматических сообщений от этого сервера.',
  'This note does not exist or you do not have permission to view it.' => 'Это примечание не существует или у Вас нет прав для просмотра.',
  'This note has been deleted. The deletion will need to be reviewed by a moderator.' => 'Эта заметка была удалена. Удаление должно быть проверено модератором.',
  'This note has been deleted. You should review the deletion and then %1$s or %2$s it.' => 'Эта заметка была удалена. Вы должны пересмотреть это удаление, а затем %1$s или %2$s его.',
  'This note has been edited. The changes need to be reviewed by a moderator.' => 'Эта заметка была отредактирована. Изменения должны быть проверены модератором.',
  'This note has been edited. You should review the changes and then %1$s or %2$s them.' => 'Эта заметка была отредактирована. Вы должны рассмотреть это изменение, а затем %1$s или %2$s его.',
  'This option controls whether or not to automatically display content of a <i>Note</i> record on the Individual page.' => 'Этот параметр контролирует, следует ли автоматически отображать содержимое <i>Примечания</i> на странице персоны.',
  'This option controls whether or not to automatically display content of a <i>Source</i> record on the Individual page.' => 'Этот параметр определяет, следует ли автоматически отображать содержимое записи <i>Источник</i> на странице персоны.',
  'This option controls whether or not to show age of father and mother next to child’s birthdate on charts.' => 'Этот паарметр позволяет показывать возраст родителей рядом с датой рождения ребёнка на графиках.',
  'This option controls whether or not to show estimated dates for birth and death instead of leaving blanks on individual lists and charts for individuals whose dates are not known.' => 'Этот паарметр позволяет показывать примерные даты рождения и смерти вместо пустых полей на страницах персон и графиках если этих данных нет.',
  'This option controls whether or not to show the individual’s gender icon on charts.<br><br>Since the gender is also indicated by the color of the box, this option doesn’t conceal the gender. The option simply removes some duplicate information from the box.' => 'Этот параметр определяет, показывать или нет иконку пола человека в графиках.<br><br>Так как на половую принадлежность также указывает цвет окна, этот параметр не скрывает пол. Этот паарметр просто удаляет некоторые повторяющиеся данные из визитки.',
  'This option indicates whether the pedigree chart should be generated in landscape or portrait mode.' => 'Задайте горизонтальное или вертикальное позиционирование графика предков.',
  'This option will make it easier for users to download images.' => 'Эта опция позволяет упростить загрузку файлов.',
  'This option will retain family links in private records. This means that you will see empty “private” boxes on the pedigree chart and on other charts with private individuals.' => 'Этот параметр сохраняет семейные связи в частных записях. Это означает, что Вы увидите пустые «частные» поля в родословной и на других диаграммах с частными персонами.',
  'This option will show the names (but no other details) of private individuals. Individuals are private if they are still alive or if a privacy restriction has been added to their individual record. To hide a specific name, add a privacy restriction to that name record.' => 'Этот параметр будет отображать имена (но не другие детали) для частных персон. Сведения о персонах являются частными, если они еще живы, или если было добавлено ограничение конфиденциальности в их записях. Чтобы скрыть конкретное имя, добавить ограничение конфиденциальности на это имя записи.',
  'This page allows you to bypass the usual forms, and edit the underlying data directly. It is an advanced option, and you should not use it unless you understand the GEDCOM format. If you make a mistake here, it can be difficult to fix.' => 'На этой странице Вы можете редактировать исходные данные напрямую в файле GEDCOM. Это расширенный вариант, и Вы не должны использовать его, если Вы не понимаете формат GEDCOM. Если Вы совершите ошибку, то её трудно будет исправить.',
  'This page has been viewed %s time.' . "\0" . 'This page has been viewed %s times.' => 'Эта страница была просмотрена %s раз.' . "\0" . 'Эта страница была просмотрена %s раза.' . "\0" . 'Эта страница была просмотрена %s раза.',
  'This place has no coordinates' => 'У этого места нет координат',
  'This process allows the site’s owner to ensure that the new information follows the site’s standards and conventions, has proper source attributions, etc.' => 'Этот процесс позволяет владельцу сайта гарантировать, что новая информация следует стандартами сайта и соглашениями, имеет надлежащие указания источника и т.д.',
  'This record does not exist or you do not have permission to view it.' => 'Эта запись не существует или у Вас нет разрешения для просмотра.',
  'This record has been deleted. The deletion will need to be reviewed by a moderator.' => 'Эта запись была удалена. Удаление должно быть рассмотрено модератором.',
  'This record has been deleted. You should review the deletion and then %1$s or %2$s it.' => 'Эта запись была удалена. Вы должны рассмотреть удаленную запись, а затем %1$s или %2$s её.',
  'This record has been edited. The changes need to be reviewed by a moderator.' => 'Эта запись была отредактирована. Изменения должны быть рассмотрены модератором.',
  'This record has been edited. You should review the changes and then %1$s or %2$s them.' => 'Эта запись была отредактирована. Вы должны рассмотреть изменения записи, а затем %1$s или %2$s её.',
  'This repository does not exist or you do not have permission to view it.' => 'Этот архив не существует или у Вас нет прав на просмотр.',
  'This repository has been deleted. The deletion will need to be reviewed by a moderator.' => 'Это хранилище было удалено. Удаление должно быть проверено модератором.',
  'This repository has been deleted. You should review the deletion and then %1$s or %2$s it.' => 'Этот репозиторий был удален. Вы должны пересмотреть это удаление, а затем %1$s или %2$s его.',
  'This repository has been edited. The changes need to be reviewed by a moderator.' => 'Это хранилище было отредактировано. Изменения должны быть проверены модератором.',
  'This repository has been edited. You should review the changes and then %1$s or %2$s them.' => 'Этот репозиторий был отредактирован. Вы должны рассмотреть это изменение, а затем %1$s или %2$s его.',
  'This role has all the permissions of the editor role, plus permission to accept/reject changes made by other users.' => 'Эта роль имеет все разрешения роли Редактор и возможность принимать/отклонять изменения других пользователей.',
  'This role has all the permissions of the manager role in all family trees, plus permission to change the settings/configuration of the website, users, and modules.' => 'Эта роль имеет все разрешения роли Менеджер во всех генеалогических деревьях и разрешения на изменение настроек сайта, пользователей и модулей.',
  'This role has all the permissions of the member role, plus permission to add/change/delete data. Any changes will need to be reviewed by a moderator, unless the user has the “automatically accept changes” option enabled.' => 'Эта роль имеет все разрешения роли Участник и возможность добавления/изменения/удаления данных. Все изменения должны быть одобрены модератором, кроме случая когда у пользователя включен параметр "автоматически принимать изменения".',
  'This role has all the permissions of the moderator role, plus any additional access granted by the family tree configuration, plus permission to change the settings/configuration of a family tree.' => 'Эта роль имеет все разрешения роли Модератор и другие разрешения в соответствии с конфигурацией генеалогического дерева и разрешения изменять настройки генеалогического дерева.',
  'This role has all the permissions of the visitor role, plus any additional access granted by the family tree configuration.' => 'Эта роль имеет все разрешения роли Посетитель и дополнительные разрешения предоставленные настройками генеалогического дерева.',
  'This server does not support secure downloads using HTTPS.' => 'Этот сервер не поддерживает безопасные загрузки по протоколу HTTPS.',
  'This server’s memory limit is %s MB and its CPU time limit is %s seconds.' => 'Этот сервер имеет следующие настройки: лимит памяти = %s MB (рабочая память для скриптов), лимит времени CPU = %s cек. (максимальное время для исполнения скрипта).',
  'This should be a comma or space separated list of facts, in addition to birth and death, that you want to appear in chart boxes such as the pedigree chart. This list requires you to use fact tags as defined in the GEDCOM 5.5.1 standard. For example, if you wanted the occupation to show up in the box, you would add “OCCU” to this field.' => 'Это должно быть разделенный запятыми или пробелами список фактов, в дополнение к рождению и смерти, которые должны отражаться в прямоугольниках диаграмм, таких как диаграмма родословной. Этот список требует использования тегов фактов в соответствии со стандартом GEDCOM 5.5.1. Например, если вы хотите, чтобы в прямоугольнике было отражено род занятий, Вы должны добавить «OCCU» в это поле.',
  'This source does not exist or you do not have permission to view it.' => 'Этот источник не существует или у Вас нет прав для просмотра.',
  'This source has been deleted. The deletion will need to be reviewed by a moderator.' => 'Этот источник был удален. Удаление должно быть проверено модератором.',
  'This source has been deleted. You should review the deletion and then %1$s or %2$s it.' => 'Этот источник был удален. Вы должны пересмотреть это удаление, а затем %1$s или %2$s его.',
  'This source has been edited. The changes need to be reviewed by a moderator.' => 'Этот источник был отредактирован. Изменения должны быть проверены модератором.',
  'This source has been edited. You should review the changes and then %1$s or %2$s them.' => 'Этот источник был отредактирован. Вы должны рассмотреть это изменение, а затем %1$s или %2$s его.',
  'This text will be appended to each page title. It will be shown in the browser’s title bar, bookmarks, etc.' => 'Этот текст будет добавлен к каждому заголовку страницы. Также будет показано в строке заголовка браузера, закладки и т.д.',
  'This type of link is not allowed here.' => 'Этот тип ссылки не разрешен в этой записи.',
  'This user account does not have access to any tree.' => 'Эта учетная запись пользователя не имеет доступа к какому-либо дереву.',
  'This usually means that you need to change the folder permissions to 777.' => 'Обычно это означает, что Вам необходимо изменить разрешения для папок на 777.',
  'This website is being upgraded. Try again in a few minutes.' => 'Этот сайт обновляется. Повторите попытку через несколько минут.',
  'This website is down for maintenance. You should <a href="index.php">try again</a> in a few minutes.' => 'Сайт закрыт на техническое обслуживание. Вы должны <a href="index.php">повторить попытку</a> через несколько минут.',
  'This website is temporarily unavailable' => 'Сайт временно недоступен',
  'This website uses cookies to learn about visitor behaviour.' => 'Данный сайт использует куки, чтобы запоминать предпочтения посетителя.',
  'This will delete all the genealogy data from “%s” and replace it with data from a GEDCOM file.' => 'Это удалит все генеалогические данные из «%s» и заменит их на данные из другого файла GEDCOM.',
  'This will update the highest-level part or parts of the place name. For example, “Mexico” will match “Quintana Roo, Mexico”, but not “Santa Fe, New Mexico”.' => 'Эта функция добавляет часть имени или или части названия места. Например, «Mexico» будет соответствовать «Quintana Roo, Mexico», но не «Santa Fe, New Mexico».',
  'Thu' => 'Чт',
