  'To' => 'По',
  'To assist you in getting started with this block, we have created several standard templates. When you select one of these templates, the text area will contain a copy that you can then alter to suit your site’s requirements.' => 'Чтобы помочь Вам начать работу с этим блоком, мы создали несколько стандартных шаблонов. При выборе одного из этих шаблонов, текстовая область будет содержать копию, которую Вы можете изменить в соответствии с требованиями Вашего сайта.',
  'To complete the upgrade, you should install the files manually.' => 'Чтобы завершить обновление, Вы должны установить файлы вручную.',
  'To create new research tasks, you must first add “research task” to the list of facts and events in the family tree’s preferences.' => 'Чтобы создать новое исследовательское задание, Вам необходимо сперва добавить «исследовательское задание» в список фактов и событий в оцпиях вашего семейного дерева.',
  'To ensure compatibility with other genealogy applications, notes, text, and transcripts should be recorded in simple, unformatted text. However, formatting is often desirable to aid presentation, comprehension, etc.' => 'Для того, чтобы обеспечить совместимость с другими приложениями, ссылки, заметки, текст и транскрипции должны быть записаны при помощи простого, неформатированного текста. Однако часто желательно форматировать текст для облегчения представления, понимания, и т.д.',
  'To prevent visitors from accessing the website while you are in the middle of copying files, you can temporarily create a file %s on the server. If it contains a message, it will be displayed to visitors.' => 'Для предотвращения доступа к сайту, в то время как Вы копируете файлы, Вы можете временно создать файл %s на сервере. Сообщение, содержащееся в нём, будет отображаться для посетителей.',
  'To protect this private data, webtrees uses an Apache configuration file (.htaccess) which blocks all access to this folder. If your web-server does not support .htaccess files, and you cannot restrict access to this folder, then you can select another folder, away from your web documents.' => 'Чтобы защитить личные данные, webtrees использует файл конфигурации Apache (.htaccess), который блокирует весь доступ к этой папке. Если Ваш веб-сервер не поддерживает файлы .htaccess, и Вы не можете ограничить доступ к этой папке, то Вы можете выбрать другую папку, вдали от Ваших веб-документов.',
  'To reduce the size of the download, you can compress the data into a .ZIP file. You will need to uncompress the .ZIP file before you can use it.' => 'Чтобы уменьшить размер файла для загрузки, Вы можете сжать файл в формат .ZIP (архив). Затем Вам будет нужно распаковать .ZIP-файл, прежде чем Вы сможете использовать его.',
  'To set this text for other languages, you must switch to that language, and visit this page again.' => 'Для настройки данного текста на других языках необходимо переключиться на этот язык и вновь открыть данную страницу.',
  'To tell search engines that sitemaps are available, you can use the following links.' => 'Чтобы сообщить поисковым системам о карте сайта, перейдите по следующим ссылкам.',
  'To tell search engines that sitemaps are available, you should add the following line to your robots.txt file.' => 'Чтобы сообщить поисковым системам о карте сайта, добавьте следующую строку в файл robots.txt.',
  'To use a Google mail account, use the following settings: server=smtp.gmail.com, port=587, security=tls, username=xxxxx@gmail.com, password=[your gmail password]' => 'Для использования учётной записи почты Google используйте следующие параметры: сервер=smtp.gmail.com, порт=587, защита=tls, имя пользователя=xxxxx@gmail.com, пароль=[Ваш пароль в gmail]',
