  'We will now send a confirmation email to the address <b>%s</b>. You must verify your account request by following instructions in the confirmation email. If you do not confirm your account request within seven days, your application will be rejected automatically. You will have to apply again.<br><br>After you have followed the instructions in the confirmation email, the administrator still has to approve your request before your account can be used.<br><br>To sign in to this website, you will need to know your username and password.' => 'В ближайшее время Вы получите письмо по электронной почте на адрес <b>%s</b>. <br><br>Следуя инструкции в письме, Вы должны подтвердить свой адрес электронной почты на создание учетной записи. <br><br>Если Вы не подтвердите свой адрес электронной почты в течение семи дней, Ваша заявка будет автоматически отклонена. В этом случае, Вам придется пройти процедуру регистрации повторно.<br><br>После того как Вы, следуя инструкции в письме, подтвердили свой адрес электронной почты, администратор должен одобрить Вашу заявку и Вы получите подтверждение по электронной почте. <br>Только после этого, Вы сможете воспользоваться всеми преимуществами этого сайта.<br><br>Пожалуйста, запомните Ваше имя пользователя и пароль.',
