  'When a record is edited, the user and timestamp are recorded. Sometimes it is desirable to keep the existing “last change” information, for example when making minor corrections to someone else’s data. This option controls whether this feature is selected by default.' => 'Если запись редактируется, то пользователь и метки времени записываются. Иногда желательно сохранить существующий “Последнее изменение” информации, например при внесении небольших изменений в чужие данные. Этот параметр определяет, будет ли эта функция включена по умолчанию.',
  'When a user registers for an account, an email is sent to their email address with a verification link. When they follow this link, we know the email address is correct, and the “email verified” option is selected automatically.' => 'Когда пользователь регистрирует аккаунт, письмо отправляется на адрес электронной почты со ссылкой для подтверждения. После того, как пользователь нажмёт на эту ссылку, статус адреса почты автоматически меняется на "подтверждённый".',
  'When adding a link, the ID field cannot be empty.' => 'При добавлении связи поле номера записи не должно быть пустым.',
  'When adding new close relatives, you can add source citations to the records (individual and family) or to the facts and events (birth, marriage, and death). This option controls whether records or facts will be selected by default.' => 'При добавлении новых близких родственников, Вы можете добавить источник цитат для записей (индивидуальные и семейные) или к фактам и событиям (рождение, брак и смерть). Этот параметр определяет, будут ли записи или факты выбраны по умолчанию.',
  'When you add a new family member, a default surname can be provided. This surname will depend on the local tradition.' => 'При добавлении нового члена семьи, по умолчанию фамилия может быть предоставлена. Эта фамилия будет зависеть от местной традиции.',
  'When you add, edit, or delete information, the changes are not saved immediately. Instead, they are kept in a “pending” area. These pending changes need to be reviewed by a moderator before they are accepted.' => 'Когда Вы добавляете, изменяете или удаляете информацию, то сделанные изменения сразу не сохраняются. Вместо этого, изменения находятся в «ожидании». Эти ожидающие изменения должны быть проверены модератором для проверки и подтверждения.',
  'When you send this message you will receive a copy sent via email to the address you provided.' => 'Вы получите копию сообщения на указанный Вами адрес.',
