  'You can choose whether to appear in the list of users who are currently signed-in.' => 'Этот флажок контролирует видимость для других пользователей, пока вы находитесь в сети. Он также контролирует вашу способность видеть других интернет-пользователей, которые настроены, чтобы быть видимыми. <br> Если этот флажок снят, Вы будете полностью невидимым для других, и Вы также не сможете увидеть других онлайн-пользователей. Если этот флажок установлен, Вы будете видеть других, которые настроены, чтобы быть видимыми.',
