  'You can set the access for a specific record, fact, or event by adding a restriction to it. If a record, fact, or event does not have a restriction, the following default restrictions will be used.' => 'Вы можете установить права доступа к конкретной записи, факту или событию, добавляя ограничение к нему. Если запись, факт или событие не имеет ограничений, будут использоваться права доступа по умолчанию.',
  'You can speed up the privacy calculations by adding a death record to individuals whose death can be inferred from other dates, but who do not have a record of death, burial, cremation, etc.' => 'Вы можете ускорить вычисление уровня конфиденциальности добавив запись о смерти к личной записи человека, чья смерть исходит из других данных, но у которого нет никаких записей о смерти, захоронения, кремации и тд.',
